func TestConvert_ConvertTx(t *testing.T) {
	convert := NewConvert("", "bty", nil)
	convertMiner(t, convert)
	convertOpen(t, convert)
	convertClose(t, convert)
	convertBind(t, convert)
	convertGenesis(t, convert)

}

